import React from "react";
import Arr from "./new"

function Main(){
    return (
        <>
        
           <div className = "container">
           <span className="idno">{ Arr[0].id }</span><br />
               <img src = {Arr[0].img1} className="imgs" />
               <div>
                   <h1>{Arr[0].model}</h1>
                   <hr></hr>
                   <p>features</p>
               </div>
            </div> 
        </>
        )
    }

export default Main;
